import Films from "./Pages/Films/Films";
import Login from "./Pages/Login/Login";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'


function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/">
            <Films />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
